import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function FoodTable() {
  const [foods, setFoods] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [filteredFoods, setFilteredFoods] = useState([]);

  const fetchData = () => {
    // Replace this with your actual API call to fetch data
    const mockData = [
      { name: 'Apple', protein: 0.3, carbs: 25, fat: 0.4 },
      { name: 'Banana', protein: 1.3, carbs: 27, fat: 0.4 },
      { name: 'Chicken Breast', protein: 31, carbs: 0, fat: 3.6 },
      // Add more food items as needed
    ];
    setFoods(mockData);
    setFilteredFoods(mockData);
  };

  const handleSearch = () => {
    const filtered = foods.filter(food =>
      food.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setFilteredFoods(filtered);
  };

  return (
    <div className="container mt-4">
      <div className="input-group mb-3">
        <input
          type="text"
          className="form-control"
          placeholder="Search for foods"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <div className="input-group-append">
          <button className="btn btn-primary" type="button" onClick={handleSearch}>Search</button>
        </div>
      </div>
      <button className="btn btn-primary mb-3" onClick={fetchData}>Show All Foods</button>
      <table className="table">
        <thead className="thead-dark">
          <tr>
            <th>Name</th>
            <th>Protein (g)</th>
            <th>Carbs (g)</th>
            <th>Fat (g)</th>
          </tr>
        </thead>
        <tbody>
          {filteredFoods.map((food, index) => (
            <tr key={index}>
              <td>{food.name}</td>
              <td>{food.protein}</td>
              <td>{food.carbs}</td>
              <td>{food.fat}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FoodTable;
